sys_variable_value.value:
(function execute(inputs, outputs) {
  var region = inputs.region.trim();
  var session = gs.getSession();
  session.putClientData('SN_AWS_LOAD_BALANCING_REGION', region || "us-east-1");
  session.putClientData("SN_AWS_LOAD_BALANCING_FILTER", null);
  outputs.region = region;
})(inputs, outputs);

